import React from "react";
import { Link } from "react-router-dom";
import { BsSearch } from "react-icons/bs";

const Navbar = function () {
  return (
    <div style={{ position: "fixed", zIndex:"1" }}>
      <nav className="navbar has-background-black-ter mb-4">
        <Link to="/">
          <figure>
            <img
              style={{ marginLeft: "20px" }}
              className="image is-64x64"
              src="https://www.themoviedb.org/assets/2/v4/logos/v2/blue_square_1-5bdc75aaebeb75dc7ae79426ddd9be3b2be1e342510f8202baf6bffa71d7f5c4.svg"
              alt="TMDB Logo"
            ></img>
          </figure>
          {/* <h3 className="navbar-item has-text-white"></h3> */}
        </Link>
        {/* <div className="navbar-item navbar-end">
        <Link to="/search">
          <button className="button is-ghost has-text-white"></button>
        </Link>
      </div> */}
        <div className="navbar-item navbar-end has-text-white">
          <Link to="/users">
            <button style={{ marginRight: "15px" }} className="button is-white">
              Users
            </button>
          </Link>
          <Link to="/search">
            <button style={{ marginRight: "15px" }} className="button is-white">
              <BsSearch />
            </button>
          </Link>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
